import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";


export const logIn = createAsyncThunk("LOG_IN", (userData) => {
      return usersRequests
  .post("/login", userData)
    .then((loggedInUser) => loggedInUser.data)
    .catch((error) => {
      throw new Error(error.message);
   });
 });
